import SmChildComponent from "./SmChildComponent";


class SmParentComponent extends Component{
    render(){
        return (
            <>
            <h1>Hello From SM Parent</h1>
            <SmChildComponent name={"Aniket"}/>
            </>
        )
    }

}
export default SmParentComponent;
